import { Grid } from "@mui/material";
import * as React from 'react';
import savingsLogo from "../../img/savings.svg";

function Home() {
  return (
    <>
      <Grid
        container
        justifyContent="center"
        alignItems="center"
        style={{ minHeight: '100vh' }}>
      
        <Grid item>
        <Grid
        container
        justifyContent="center"
      >
        Welcome
      </Grid>        
          <img
            src={savingsLogo}
            style={{
              width: '50%',
              display: 'block',
              margin: '0 auto'
            }}
            alt="Savings Logo"
          />
        </Grid>
      </Grid>
    </>
  );
}

export default Home;
